import '../styles/globals.css'
import { motion, AnimatePresence } from "framer-motion"

export default function main ({ Component, pageProps }) {
  return (
  	<AnimatePresence>
  		<motion.div initial="hidden" animate="visible" variants={{
  hidden: {
    opacity: 0
  },
  visible: {
    scale: 1,
    opacity: 1,
    transition: {
      delay: .4
    }
  },
}}>
  			<Component {...pageProps} />
  		</motion.div>
  	</AnimatePresence>
  )
}
